import React from "react";
import "./ProjectsStyles.css"; // Assuming ProjectsStyles.css is in the same directory
import { getImg } from "../../utils";

const ProjectCard = ({
  project: { title, imageSrc, description, skills: projectSkills, demo, source },
}) => {
  return (
    <div className="container">
      <img src={getImg.title} alt={title} className="image" />
      <h3 className="title">{title}</h3>
      <p className="description">{description}</p>
      <ul className="skills">
        {projectSkills.map((skill, id) => {
          return (
            <li key={id} className="skill">
              {skill}
            </li>
          );
        })}
      </ul>
      <div className="links">
        <a href={demo} className="link">
          Demo
        </a>
        <a href={source} className="link">
          Source
        </a>
      </div>
    </div>
  );
};

export default ProjectCard;
